const _hoisted_7 = /* @__PURE__ */ createStaticVNode('<h2 id="info" tabindex="-1"><a class="header-anchor" href="#info" aria-hidden="true">#</a> Info</h2><p><strong>Bio-Data</strong></p><ul><li>Class: Saber</li><li>True Name: Elizabeth Bathory</li><li>Gender: Female</li><li>Source: FGO Halloween 2016</li><li>Region: Prison Castle Csejte</li><li>Alignment: Chaotic Evil (ingame is Chaotic Good. lol wakannai)</li><li>Height: 154 cm</li><li>Weight: 44 kg</li></ul><p><strong>Meta</strong></p><ul><li>Setting creation: Nasu Kinoko</li><li>Character design: Wada Arco</li><li>CV: Ookubo Rumi</li><li>Main works appearance: Fate/Grand Order</li></ul><h2 id="stats" tabindex="-1"><a class="header-anchor" href="#stats" aria-hidden="true">#</a> Stats</h2><table><thead><tr><th style="text-align:left;">Parameters</th><th style="text-align:center;">Values</th></tr></thead><tbody><tr><td style="text-align:left;">Strength</td><td style="text-align:center;">B</td></tr><tr><td style="text-align:left;">Constitution</td><td style="text-align:center;">C</td></tr><tr><td style="text-align:left;">Agility</td><td style="text-align:center;">C</td></tr><tr><td style="text-align:left;">Magical Power</td><td style="text-align:center;">C</td></tr><tr><td style="text-align:left;">Luck</td><td style="text-align:center;">B</td></tr><tr><td style="text-align:left;">Noble Phantasm</td><td style="text-align:center;">C</td></tr></tbody></table><h2 id="class-skills" tabindex="-1"><a class="header-anchor" href="#class-skills" aria-hidden="true">#</a> Class Skills</h2><p><strong>Magic Resistance: [A]</strong></p><p>Invalidates magic A and below, no matter what kind of great thaumaturgy it is.<br> A hero is expected to do at least this much.</p><p><strong>Territory Creation: [C]</strong></p><p>The ability to create workshop and allied party.<br> This time it&#39;s the specialization of the ability to create campsite. A hero adventures on the field all week. The skill to swiftly establish a tent is the true mark of a leader.</p><p><strong>Double Class: [E]</strong></p><p>A miraculuous variant born from the union of Lancer and Caster.<br> No actual benefits in particular.</p><h2 id="personal-skills" tabindex="-1"><a class="header-anchor" href="#personal-skills" aria-hidden="true">#</a> Personal Skills</h2><p><strong>Hero Grand Code: [EX]</strong></p><p>First, that a hero must be invincible.<br> Second, that a hero must always be in high spirit.<br> Third, that a hero freely makes use of lost properties.<br> ......and so on and so on. Ten code in total.<br> As a Skill, think of it as a leading up towards the protagonist grand turn around, just like in action manga.<br> During that turn only, she is invincible and simultaneously has her willpower raised.<br> A hero shall accumulate NP as she endures multiple Noble Phantasm.</p><p><strong>Magic Energy Burst (Brave): [D]</strong></p><p>A Magic Energy Burst, but of an extremely rare internal type.<br> Defense power is raised. Subtly unpleasant.</p><p><strong>Legend of the Crimson Hero: [EX]</strong></p><p>The supreme privilege, the hero&#39;s greatest of esoterica usable only in the movie version.<br> A super power up by expending 100% NP. A super buff of a similar type to Tamamo-chan Summer&#39;s Goddess Transformation.<br> Randomly bestows miraculous effects such as super increase to offensive power, invincibility and recovery to entire party, and an acquisition of a large amount of stars. Unmistakably a gambler skill.<br> However, perhaps because it is a skill that displays each effects against formidable enemies, but during the occasion that such an enemy that does not depend on the system shows in front of her can a miracle happens only with this skill.</p><h2 id="noble-phantasm-s" tabindex="-1"><a class="header-anchor" href="#noble-phantasm-s" aria-hidden="true">#</a> Noble Phantasm(s)</h2><h1 id="bathory-brave-erzsebet-bloody-tornado-demoness" tabindex="-1"><a class="header-anchor" href="#bathory-brave-erzsebet-bloody-tornado-demoness" aria-hidden="true">#</a> Bathory Brave Erzsebet - Bloody Tornado Demoness</h1><ul><li>Rank: B</li><li>Type: Anti-Unit/Anti-Unit Noble Phantasm (yes, the mat said anti-unit twice)</li><li>Range: 10-30</li><li>Maximum target: 1 person</li></ul><p>Bathory Brave Erzsebet.<br> Bloody Demoness, Saber version.<br> A forbidden sword technique that affix the enemy with the hero power like that of a storm, clash into that space a full power, high gear rotating thrust and made the enemy explode.</p><p>Of course, the hero power is by means of Elizabeth&#39;s sonic breath.<br> The super thunder screw slash unleashed to the enemy whose mind and body have been stunned by Elizabeth&#39;s super sonic waves pulverizes even the Slave Beast.</p><h1 id="character" tabindex="-1"><a class="header-anchor" href="#character" aria-hidden="true">#</a> Character</h1><h2 id="pronouns" tabindex="-1"><a class="header-anchor" href="#pronouns" aria-hidden="true">#</a> Pronouns</h2><p>First pronoun: watashi kanji (atashi katakana)<br> Second pronoun: anata/koinu (puppy)/kojika (deerlet) (only FGO&#39;s protagonist)/kobuta (piglet)/korisu (squirrel) (only Fate/EXTRA&#39;s protagonist)/** (no honorifics)<br> Third pronoun: anatatachi/** (no honorifics)</p><h2 id="personality" tabindex="-1"><a class="header-anchor" href="#personality" aria-hidden="true">#</a> Personality</h2><p>The Elizabeth (Caster) who make Halloween merry and festive, turned into Saber at the end of elegant fate.<br> Her mood swing and wickedness took a dip, and although selfishness remains her personality becomes one that help the weak and outwit the strong.<br> Saber = Ally of Justice. Maybe that&#39;s what she think of it, but anyway she misunderstand herself as one positioned as a hero, and just like that she is giving it her all the Elizabeth way. Ish.<br> However, she is not used to be a character on the side of justice, so she messes up a lot as usual.</p><h2 id="attitude-towards-master" tabindex="-1"><a class="header-anchor" href="#attitude-towards-master" aria-hidden="true">#</a> Attitude Towards Master</h2><p>She is a hero, so she is brimming with the spirit to fight alongside the Master.<br> She personally feels she is bound by a tight friendship with the Master.<br> Her awareness as a Servant is low.</p><h2 id="dialogue-examples" tabindex="-1"><a class="header-anchor" href="#dialogue-examples" aria-hidden="true">#</a> Dialogue Examples</h2><p>&quot;See here, I&#39;m like, a hero right? And a hero must have a variety of party members, right? Just like when I was an idol, suppoerted by drums and instruments.&quot;<br> &quot;No worries, puppy/deerlet! Because I, the hero, and this darkish no good trio will protect you!&quot;<br> &quot;Yes. I am the new me, emerging from humiliation and conflict, dispossessed of evertyhing to you. Class Saber type idol, Elizabeth Brave Bathory!&quot;</p><h2 id="character-in-fgo" tabindex="-1"><a class="header-anchor" href="#character-in-fgo" aria-hidden="true">#</a> Character in FGO</h2><p>Appearing as the main character of Halloween 2016.<br> With the power of dragon and music, as well as the second Halloween, it feels like nobody can stop her anymore.<br> With pure white mantle, deep crimson armor, and a simple sword without any decoration on her hand, today too shall the Hero Elizabeth conquer.<br> Well, she doesn&#39;t really practice any sort of sword skill, so she just blows it away with full power.<br> Bound with tight friendship with the Master, not even the sword of civilization destruction or theater of lasers or foxy curses can cut it apart. Is what she believes. (Due to that she has no awareness as a Servant.)</p><p>&quot;Maybe I&#39;m not actually a hero, just a sexy female knight, and the true hero is the puppy/deerlet...&quot;</p><p>Is what going on her head sometimes, but that in itself is not bad, huh! is her positive thinking, following her own path. Truly a hero.</p><p>By the way the name of the sword is the famed sword Eighteen, and the name of the shield is the famed shield Retronia.</p><h2 id="related-characters" tabindex="-1"><a class="header-anchor" href="#related-characters" aria-hidden="true">#</a> Related Characters</h2><p><strong>Cleopatra</strong></p><p>I must admit she is a genius. It&#39;s a bit unthinkable to put a castle on top of other&#39;s castle. It&#39;s like an ice cream, so cute! But spare me a third one.</p><p><strong>Robin Hood</strong></p><p>That Greeny. I had thought that he was simply a rat who would bite back at the feudal lord no matter what, but seems like depending on the situation he would help too. Maybe he has some kind of knightly groundings...? This time, I will show him how to Brave!</p><p><strong>Gawain</strong></p><p>Such a dreamy, prince charming of a Saber...! He must have only about 1 Buster Card. Unmistakably a magnificent Saber!</p><p><strong>Jeanne d&#39;Arc Alter Santa Lily</strong></p><p>Christmas is a rival. I&#39;m envious of box gacha and such, yes, but no thank you. Really, aren&#39;t you embarassed for picking up such a greedy atmosphere?</p><p><strong>Tamamo-chan Summer</strong></p><p>We are both anti-heroes, but I just can&#39;t win against that fox&#39;s free spirit... Actually, just when did she ended up getting the demon king role...</p><h2 id="comment-from-the-illustrator" tabindex="-1"><a class="header-anchor" href="#comment-from-the-illustrator" aria-hidden="true">#</a> Comment from the Illustrator</h2><p>I got the assignment to make a bikini armor. Because of that, I just straight up draw the homage to Genmu Senki Leda&#39;s Yohko and Dragon Quest 3&#39;s Female Knight. Elizabeth has quite an extraordinary slender body, so she can totally pull it off with the bikini armor!!!!!!!!! (Wada Arco)</p><h2 id="material-images" tabindex="-1"><a class="header-anchor" href="#material-images" aria-hidden="true">#</a> Material Images</h2><p>(Lib will add after publish)</p><h2 id="dialogue" tabindex="-1"><a class="header-anchor" href="#dialogue" aria-hidden="true">#</a> Dialogue</h2><table><thead><tr><th style="text-align:left;">Occassion</th><th style="text-align:center;">English</th><th style="text-align:center;">Japanese</th></tr></thead><tbody><tr><td style="text-align:left;">Summoned</td><td style="text-align:center;"></td><td style="text-align:center;"></td></tr></tbody></table>', 57);
